package main

import (
	cryptoRand "crypto/rand"
	"encoding/binary"
	"encoding/json"
	"fmt"
	"log"
	"math/rand"
	"time"
)

type (
	User struct {
		ID        string
		Email     string
		Balance   int64
		Address   *Address
		Age       uint8
		LastLogin time.Time
	}
	Address struct {
		City    string
		ZipCode uint
	}
)

func init() {
	buf := make([]byte, 8)
	cryptoRand.Read(buf)
	intVal := binary.LittleEndian.Uint64(buf)
	rand.Seed(int64(intVal))
}

func main() {
	ret := []*User{}
	for i := 0; i < 3000; i++ {
		nbPossibilities := len(names) - 1

		user := new(User)
		user.ID = fmt.Sprintf("%d", i)
		user.Email = fmt.Sprintf("%s-%d@%s.com", names[rand.Intn(nbPossibilities)], i, names[rand.Intn(nbPossibilities)])
		user.Balance = rand.Int63()
		if rand.Int()%20 == 0 {
			user.Balance = -user.Balance
		}
		user.Age = uint8(rand.Intn(110))
		user.LastLogin = time.Now().Add(-time.Second * time.Duration(rand.Intn(63331200)))

		address := new(Address)
		address.City = names[rand.Intn(nbPossibilities)]
		address.ZipCode = uint(rand.Intn(99999))
		user.Address = address

		ret = append(ret, user)
	}

	retAsBytes, err := json.Marshal(ret)
	if err != nil {
		log.Fatal(err)
	}

	fmt.Println(string(retAsBytes))
}

